import React from 'react';
import TextField from '@mui/material/TextField';
import { makeStyles } from '@mui/styles';
import Autocomplete from '@mui/material/Autocomplete';
import Grid from '@mui/material/Grid';
import { styled } from "@mui/material/styles";



const calStyle = makeStyles({
    cal: {
       display: 'absolute',
       position: 'absolute',
       textAlign: 'center',
       width: '100%',
       height: '100%',
       backgroundColor: '#F1F2ED',

   },
   text:{
    position: 'relative',
    top: '50%',

    width: '80%',
   },
   state:{
    width: '80%',
   }
})

const stateName = [
    {label:'New South Wales and ACT', value:'01'},
    {label:'Victoria', value:'02'},
    {label:'Queensland', value:'03'},
    {label:'New South Australia', value:'04'},
    {label:'Western Australia', value:'05'},
    {label:'Tasmania', value:'06'},
    {label:'Northern Territory', value:'07'},
  ]

export default function elecal() {
    const classes = calStyle();
  return (

    <>
    <div>
        <Grid container spacing={2}>
            <Grid item xs={12} md={6}>
                <Autocomplete
                className={classes.text}
                disablePortal
                id="state"
                options={stateName}
                sx={{ width: 300 , mt: 2}}
                renderInput={(params) => <TextField {...params} label="state" />}
                onChange={(event,statevalue) => console.log(statevalue)} 
                />
            </Grid>
            <Grid item xs={12}md={6}>
                <TextField
                className={classes.text}
                required
                id="outlined-required"
                label="electricity(kWh)"
                defaultValue="0"
                />
            </Grid>
        </Grid>
    </div>
    </>
  )
}
